The data router routes requests from RabbitMQ and Kafka to the correct storage solution based on the schema and data type. Topic and some of the basic configuration is obtained from Schema Registry. Data are routed and deposited onto configured queues. Interacts with: Command Service (optional, either) Message Queue (optional, either) Schema Registry Ingest methods: Kafka Internal communication methods: Kafka (command-service) gRPC (schema-registry) Below are the example data required by data router: # high level description
{ "schemaId": <UUID>, "objectId": <UUID>, "data": { "some_property": "object"}
} # type description
{ "objectId"(string) : (128bit valid uuid), "schemaID"(string) : (128bit valid uuid), "data"(string) : (array,dict,object,string, literally anything),
} # example, minimalistic one liner
{ "objectId": 9056c0b3-2ceb-42a6-a6b6-9718c3e273bc, "schemaId": 9056c0b3-2ceb-42a6-a6b6-9718c3e273bc, "data": {} } Messages can be batched together, however please mind, that batched messages works best when used with the same schemaId. Otherwise, messages will be split into sub-batches containing messages with the same schemaId [ { "objectId": 9056c0b3-2ceb-42a6-a6b6-9718c3e273bc, "schemaId": f79d7ebd-4260-4919-9ba3-45ea6701f065, "data": {} } { "objectId": 9056c0b3-2ceb-42a6-a6b6-9718c3e273bc, "schemaId": 9056c0b3-2ceb-42a6-a6b6-9718c3e273bc, "data": {} } { "objectId": 0369de4f-8025-4cf8-b6df-9446b51e4fd0, "schemaId": 9056c0b3-2ceb-42a6-a6b6-9718c3e273bc, "data": {} } { "objectId": 0369de4f-8025-4cf8-b6df-9446b51e4fd0, "schemaId": 07087162-e499-48f1-ad4a-cee7e77f1965, "data": {} }
] Please mind that internally, each message will get its own timestamp, with which data started being processed by CDL. This information is invisible for user.

