To materialize view one needs proper setup. Firstly, system needs schema which informs where store data (for example in document storage like Postgres). Secondly, it needs view definition which informs what fields are necessary and from which schema it should take it. It also defines where to put materialized data. During this tutorial we are going to introduce several ways of inserting and mutating state of CDL. One of them (graphQL) is designed only for managament and test purposes. However, it is the easiest way to quickly manually test the materialization pipeline. A) Manual setup Most common and production-like way to setup is by sending requests to schema registry. Adding new schema A) gRPC API To add new schema we need to load schema_registry.proto to our client. In this tutorial we are going to use BloomRPC. All proto files are stored in crates/rpc/proto directory. In proto file we can see that message NewSchema uses bytes as a definition. In bloomRPC it means we need to encode our json definition in base 64: Schema definition: { "name": "string"
} Encoded: ewogICAgIm5hbWUiOiAic3RyaW5nIgp9 Usually schema registry API is available at http://localhost:50101 . RPC request (schema_registry.SchemaRegistry.AddSchema): { "metadata": { "name": "tutorial-schema", "insert_destination": "cdl.document.1.data", "query_address": "http://localhost:50201", "schema_type": 2 }, "definition": "ewogICAgIm5hbWUiOiAic3RyaW5nIgp9"
} RPC response: { "id": "22c8ac58-155e-4643-ab44-42e96dbb88c7"
} Lets save this UUID for later. It is schema_id. B) graphQL API (management and test purposes only) Instead of using gRPC we can also leverage graphQL Gateway API to manage all schemas: An easy to use interface is available at http://localhost:50106/graphiql Mutation request: mutation addSchema { addSchema(new: { insertDestination: "cdl.document.1.data", name: "tutorial-schema", queryAddress: "http://localhost:50201", type: DOCUMENT_STORAGE, definition: { name: "string" } }) { id }
} As you can see it does not require encoding definition, and it can return all schema metadata, therefore we filter it to retrieve only schema_id. Adding new view Next we need to add new view definition. A) gRPC API gRPC request (schema_registry.SchemaRegistry.AddViewToSchema): { "schema_id": "22c8ac58-155e-4643-ab44-42e96dbb88c7", "name": "tutorial-view", "materializer_address": "http://localhost:50203", "materializer_options": "{\"table\": \"MATERIALIZED_VIEW\"}", "fields": { "worker_name": "{ \"field_name\": \"name\" }" }
} As you can see this time materializer_options are not using bytes format but are encoded in the string. See Issue #442 . gRPC response: { "id": "ddfc1f23-7b13-4d8e-b8ab-1def8eb30a4e"
} This is the view_id. B) graphQL API (management and test purposes only) Mutation request: mutation addView{ addView(schemaId: "22c8ac58-155e-4643-ab44-42e96dbb88c7", newView: { name: "tutorial-view", materializerAddress: "http://localhost:50203", materializerOptions: { table: "MATERIALIZED_VIEW" }, fields: { worker_name: { field_name: "name" } } }) { id }
} B) Loading initial schema While manual setup is fine for one-time test, it quickly becomes mundane work. To mitigate this problem, we created a solution to pre-populate schema registry. In fact, Common Data Layer deployment repository already contains bare/setup/schema-registry/initial-schema.kafka.json which describes what views and schemas should be inserted on startup.

