Instead of waiting seconds for on-the-fly materialization, we can also demand materialized view via gRPC call. A) gRPC API gRPC request to http://localhost:50108/ (materializer_ondemand.OnDemandMaterializer.Materialize): { "view_id": "ddfc1f23-7b13-4d8e-b8ab-1def8eb30a4e", "schemas": { "22c8ac58-155e-4643-ab44-42e96dbb88c7": { "object_ids": [ "dc8cc976-412b-11eb-8000-100000000000", "dc8cc976-412b-11eb-8000-000000000000" ] } }
} For now user needs to use filter and enlist in the request all object ids. There is, however, an issue which should mitigate this problem very soon. This call returns the stream of rows, instead of collection. Thanks to that, both object builder, on demand materializer and client code don't have to allocate enormous amount of memory when handling bigger tables. It also means client code can start processing data faster. BloomRPC returns messages in seperate tabs: Stream 1: { "fields": { "worker_name": "\"John\"" }, "object_id": "dc8cc976-412b-11eb-8000-100000000000"
} Stream 2: { "fields": { "worker_name": "\"Alice\"" }, "object_id": "dc8cc976-412b-11eb-8000-000000000000"
} B) graphQL API (management and test purposes only) graphQL request: query onDemandView { onDemandView( request: { viewId: "ddfc1f23-7b13-4d8e-b8ab-1def8eb30a4e" schemas: [ { id: "22c8ac58-155e-4643-ab44-42e96dbb88c7" objectIds: [ "dc8cc976-412b-11eb-8000-100000000000", "dc8cc976-412b-11eb-8000-000000000000" ] } ] } ) { id rows { fields objectId } }
} Unfortunately, graphQL does not support streaming, which means all rows are collected to the array before sending it to the client. Please use it wisely and carefuly (on smaller sets of data).
